let bigAdd l1 l2 = 
  let add (l1, l2) = 
    let f a x = 
      let (carry, rest) = a in
      let (d1, d2) = x in
      let sum = d1 + d2 + carry in
        if (sum > 9) then
          (1, (sum - 10)::rest)
        else
          (0, sum::rest) in
    let base = (0, []) in
    let args = List.combine (List.rev (0::l1)) (List.rev (0::l2)) in
    let (_, res) = List.fold_left f base args in
      res
  in 
    removeZero (add (padZero l1 l2))



