  let rec mulHelper l' = match l' with
    | [] -> (0,[])
    | h :: t -> let (carry, rest) = mulHelper t in
        let prod = i * h + carry in
          (prod/10, (prod mod 10) :: rest) in
  let (_, ans) = mulHelper (0::l) in
    removeZero ans



